import logo from './logo.svg';
import './App.css';
import {Wallet} from './components/Wallet';
import {PortalButton} from './components/PortalButton';

function App() {

  return (
    <div className="App">
      <div className="Navbar">
          <Wallet />
      </div>
      <div classname="Portal">
            <img src={logo} className="App-logo" alt="logo" />
          <PortalButton />
      </div>


    </div>
  );
}

export default App;
